import React from "react";

const FeaturedCard = ({ featured, title, start }) => {
  return (
    <div className="hover:border-2 border-white m-auto max-sm:w-32 max-md:w-40 w-60 hover:shadow-xl rounded-lg">
      <div className="max-sm:max-h-32 max-md:max-h-40 max-h-60 flex flex-col items-center">
        <img src={featured} alt="" />
      </div>
      <div className="p-2 flex flex-col items-center">
        <h1 className="max-md:text-sm font-semibold">{title}</h1>
        <h1 className="max-md:text-xs font-medium text-sm">{start}</h1>
      </div>
    </div>
  );
};

export default FeaturedCard;
